  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Pea Island NWR for the next 15 years. This plan
  outlines the Refuge vision and purpose and describes how Pea Island NWR will contribute
  to the overall mission of the Refuge System. The plan provides an introduction to
  the Refuge, an overview of the CCP process, information about plan development and
  the management direction, and strategies for implementation. Key planning issues
  include: hydrology, fish and wildlife populations, habitats, public use, resource
  protection, and administration.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
